import React, { PureComponent } from 'react'
import FormApp from './Form'

class Form extends PureComponent {
    constructor(){
        super() 
        this.state = {
            value : ''
        }
        this.anyText = () => this.setState({ text : "text setado"})   
    }

    componentDidMount (){
        this.anyText()
    }

    componentDidUpdate (){

        console.log(this.state.text)
    }


    render () {     
        const { value } = this.state.value
        const { handleChange } = this.handleChange
        return(
            <FormApp value={value} handleChange={handleChange}/>
        )
    }
}



export default Form
